import "./links.css";
import "./social.css";
import "./share.css";
import Footer from "./component/footer";
import "./footer.css";
import Home from "./pages/Home";
import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className='App'>
      <Routes path='/'>
        <Home />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
